webpackJsonp([0x81b8806e4260],{478:function(e,t){e.exports={data:{authors:{edges:[{node:{id:"alcopanda",name:"Маша Милованова",image:"https://hb.bizmrg.com/urbantrip/media/avatars/alcopanda.jpg",url:"http://gatsbyjs.org/",bio:"Маша. @zhptrs @fokincookin"}},{node:{id:"casper",name:"Casper User",image:"https://api.adorable.io/avatars/150/test.png",url:"http://gatsbyjs.org/",bio:"Yeah, I like animals better than people sometimes... Especially dogs. Dogs are the best. Every time you come home, they act like they haven't seen you in a year. And the good thing about dogs... is they got different dogs for different people."}},{node:{id:"Vladimir",name:"Urban",image:"https://hb.bizmrg.com/urbantrip/media/avatars/vladimir.jpg",url:"http://gatsbyjs.org/",bio:"Просто вова"}},{node:{id:"Boris T",name:"Борис",image:"https://hb.bizmrg.com/urbantrip/media/avatars/boris.jpg",url:"http://gatsbyjs.org/",bio:"Лучше звоните борису"}},{node:{id:"guinevere",name:"Guinevere Kuiper",image:"https://randomuser.me/api/portraits/women/17.jpg",url:"https://randomuser.me/api/?seed=user1",bio:"Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam laoreet lorem nec ligula aliquet, porta blandit augue luctus. Vivamus ac quam diam. Sed vestibulum pharetra hendrerit."}}]}},pathContext:{nodes:[{node:{frontmatter:{title:"Алкотрип в Абхазию",tags:["Абхазия"],cover:"http://v-georgia.com/wp-content/uploads/2017/09/shutterstock_1480655391-1920x12801500.jpg",date:"2018-06-13",category:"",author:"alcopanda"},fields:{slug:"/алкотрип-в-абхазию"},excerpt:'<div class="tg-timestamp">10:51</div>\nВсем привет, нас Вова из @UrbanRuTrip не пустил в свой канал, да и хуй с ним. Нам ничего не смогло помешать завести свой. \\nЗавтра мы стартуем из Ульяновска в Казань, а оттуда в Сочи, а оттуда в Абхазию. Едем мы, честно говоря, пожрать, выпить, пребывать в режиме бесполезной мрази. Ну и посетить пару-тройку достопримечательностей, может быть сгоняем в соседние города.\\nМы не рассчитываем на дохуя подписчиков, т.к. мы опять воспринимаем канал как записную книжку и облачное хранилище фоток.\\n\\nСначала я хотела запилить лонгрид с всяким полезным по итогам, потом вспомнила, что нихуя не запоминаю, если сразу это не записываю, так что буду писать сюда, а потом мож выкачу текст с выжимкой. Зачем? Затем что я очень заебалась гуглить про Абхазию, никто не пишет ничего полезного, все высирают 9000 фоток, сопровождая это всё текстами в духе «Охуенно-заебись, всё очень вкусно, вот фотка монастыря, а вот кусок текста из вики». +Охулиард рассказов, как же там всё хуёво, нет сервиса и так далее. Опять же с нулём конкретики.\\nНу, охуеть теперь. В общем, надеюсь в итоге написать полезных рекомендаций. \\nПостить будем примерно в таком же формате, как в УрбанТрипе. Оставайтесь на связи. ',timeToRead:17}},{node:{frontmatter:{title:"Вова на кавказе",tags:["Грузия","Сочи"],cover:"http://v-georgia.com/wp-content/uploads/2017/09/shutterstock_1480655391-1920x12801500.jpg",date:"2018-06-04",category:"",author:"Vladimir"},fields:{slug:"/вова-на-кавказе"},excerpt:'<div class="tg-timestamp">15:44</div>\n#nextrip будет от меня, следующие две недели я буду вас утомлять собой. Сейчас я транзитом в Сочи, чтобы завтра оказаться в Грузии. В Сочи особо нечего смотреть, на обратном пути будет время погулять.  Чуть позже дам подробностей про то, где и чего и как. ',timeToRead:9}},{node:{frontmatter:{title:"Боря в гостях у немчуры",tags:["Германия"],cover:"https://unsplash.it/1280/500/?random?BoldMage",date:"2018-05-01",category:"",author:"Boris T"},fields:{slug:"/боря-в-гостях-у-немчуры"},excerpt:'<div class="tg-timestamp">12:30</div>\nАню смутил побег подписчиков и она стесняется писать дальше (на самом деле нет). Ну да ладно, идём дальше. \\n\\nВы же помните Бориса и его эпичный рассказ из Воркуты? На этот раз Борис держит путь в Германию и далее. Чуть позже расскажет, как он пугает бюргеров распевая «Рожа твоя кислая уже мне надоела» (на самом деле нет). ',timeToRead:11}}],page:1,pages:1,total:3,limit:10}}}});
